data.value:
[LAYOUT]
-- General layout
<T>TICKET
<L00>Date:{TICKET DATE}
<L00>Time:{TIME}
{RESOURCES}
<L00>Ticket No:{TICKET NO}
<F>-
{ORDERS}
<F>=
<EB>
<J10>{IF DISCOUNT}
<J10>Total Gift:|{GIFT TOTAL}
<J10>Total:|{TICKET TOTAL}
{IF PAID}
<DB>
<F>=
<C10>T H A N K    Y O U

[ORDERS]
-- Default format for orders
<J00>- {QUANTITY} {NAME}|{PRICE}
{ORDER TAGS}

[ORDERS:GIFT]
-- Format for gifted orders
<J00>- {QUANTITY} {NAME}|**GIFT**
{ORDER TAGS}

[ORDERS:VOID]
-- Nothing will print for void lines

[ORDER TAGS]
-- Format for order tags
<J00>     * {ORDER TAG NAME} | {ORDER TAG PRICE}

[RESOURCES:Table]
-- Table resource format
<L00>Table: {RESOURCE NAME}

[RESOURCES:Customer]
-- Customer resource format
<J00>Customer: {RESOURCE NAME} | {RESOURCE DATA:Phone}

[LAYOUT]
<T>TICKET
<L00>Datum:{TICKET DATE}
<L00>Vrijeme:{TIME}
<L00>Location No:{LOCATION}
<L00>Ticket No:{TICKET NO}
<F>-
{ORDERS}

[ORDERS]
<J00>- {QUANTITY} {NAME}|{PRICE}
{ORDER TAGS}

[ORDERS:GIFT]
<J00>- {QUANTITY} {NAME}|{PRICE}
{ORDER TAGS}

[ORDERS:VOID]
<J00>- {QUANTITY} {NAME}|{PRICE}
{ORDER TAGS}

[ORDER TAGS]
-- Format for order tags
<L00>     * {ORDER TAG NAME}
